import React from 'react';

function UserPage(props) {

  const passwordsTest = [
    {
      app: 'Instagram',
      login: 'secondW4ve',
      password: '1234',
    },
    {
      app: 'Telegram',
      login: 'noiseW4ve',
      password: 'yolo',
    },
    {
      app: 'Firefox',
      login: 'jura@gmail.com',
      password: 'aga',
    }
  ]


  return (
    <div>
      <div className = "table-container">
        <thead>
          <tr>
            <th>App</th>
            <th>Login</th>
            <th>Password</th>
          </tr>
        </thead>
        <tbody>
          {passwordsTest.map(record => (
            <tr>
              <td>record.app</td>
              <td>record.login</td>
              <td>record.password</td>
            </tr>
          ))}
        </tbody>
      </div>
    </div>
  );
}

export default UserPage;
